contracts/BridgeContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./WrappedBCT.sol";
import "./ERC1155Token.sol";

contract CarbonCreditBridge is Ownable {
    CarbonCreditERC1155 public carbonCreditERC1155;
    mapping(address => bool) public supportedWrappers;

    constructor(address _carbonCreditERC1155) {
        carbonCreditERC1155 = CarbonCreditERC1155(_carbonCreditERC1155);
    }

    function addSupportedWrapper(address wrapperAddress) external onlyOwner {
        supportedWrappers[wrapperAddress] = true;
    }

    function removeSupportedWrapper(address wrapperAddress) external onlyOwner {
        supportedWrappers[wrapperAddress] = false;
    }

    function wrapTokens(address wrapperAddress, uint256 amount) external {
        require(
            supportedWrappers[wrapperAddress],
            "CarbonCreditBridge: Unsupported wrapper"
        );
        WrappedBCT wrapper = WrappedBCT(wrapperAddress);
        wrapper.wrap(msg.sender, amount);
        uint256 tokenId = wrapper.getTokenId();
        carbonCreditERC1155.mint(msg.sender, tokenId, amount, "");
    }
}

contracts/ERC1155Token.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract CarbonCreditERC1155 is ERC1155, Ownable {
    uint256 private _currentTokenID = 1;

    constructor(string memory uri) ERC1155(uri) {}

    function mint(
        address to,
        uint256 id,
        uint256 amount,
        bytes memory data
    ) external {
        require(msg.sender == owner() || msg.sender == address(this), "CarbonCreditERC1155: Only owner or the contract itself can mint tokens");
        _mint(to, id, amount, data);
    }

    function mintFungibleToken(
        address to,
        uint256 amount,
        bytes memory data
    ) external onlyOwner {
        _mint(to, _currentTokenID, amount, data);
        _currentTokenID += 1;
    }

    function mintNonFungibleToken(
        address to,
        bytes memory data
    ) external onlyOwner {
        _mint(to, _currentTokenID, 1, data);
        _currentTokenID += 1;
    }

    function burn(
        address account,
        uint256 id,
        uint256 amount
    ) external onlyOwner {
        _burn(account, id, amount);
    }

    function setURI(string memory newuri) external onlyOwner {
        _setURI(newuri);
    }
}

contracts/OffsetContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./BridgeContract.sol";
import "./ERC1155Token.sol";

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract OffsetServiceContract is ERC1155, Ownable {
    uint256 private _currentNFTId;

    CarbonCreditBridge private _carbonCreditBridge;
    CarbonCreditERC1155 private _carbonCreditERC1155;

    constructor(address carbonCreditBridgeAddress, address carbonCreditERC1155Address, string memory uri) ERC1155(uri) {
        _carbonCreditBridge = CarbonCreditBridge(carbonCreditBridgeAddress);
        _carbonCreditERC1155 = CarbonCreditERC1155(carbonCreditERC1155Address);
    }

    function offsetCarbonCredits(
        address user,
        uint256 tokenId,
        uint256 amount
    ) external {
        require(
            _carbonCreditERC1155.balanceOf(user, tokenId) >= amount,
            "Not enough carbon credits"
        );

        // Burn carbon credits
        _carbonCreditERC1155.burn(user, tokenId, amount);

        // Mint NFT receipt
        _mint(user, _currentNFTId, 1, "");
        _currentNFTId++;
    }
}

contracts/WrappedBCT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract WrappedBCT is Ownable {
    IERC20 public wrappedToken;
    uint256 public tokenId;

    constructor(address _wrappedToken, uint256 _tokenId) {
        wrappedToken = IERC20(_wrappedToken);
        tokenId = _tokenId;
    }

    function wrap(address user, uint256 amount) external {
        require(
            wrappedToken.transferFrom(user, address(this), amount),
            "WrappedBCT: Transfer failed"
        );
    }


    function unwrap(address user, uint256 amount) external onlyOwner {
        require(
            wrappedToken.transfer(user, amount),
            "WrappedBCT: Transfer failed"
        );
    }

    function getTokenId() external view returns (uint256) {
        return tokenId;
    }
}

